import React from "react";
const Header = () => {

return(
    <>
      <div className="header fixed-top">
          <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQM5UY-k6XvIz9YE2mhOpcPJOCEli39R8_9BQ&usqp=CAU" alt="logo" />
          <h1> Google Keep</h1>
      </div>
    </>
);
};
export default Header;
